import React from 'react';
import './App.css';
import Header from "./components/Header"
import Navigation from "./components/Navigation"
import Main from "./components/Main"
import Contact from "./components/Contact"

function App() {
    const [enabled, setEnabled] = React.useState({
        start: true,
        aboutMe: false,
        cv: false,
        skills: false
    })

    function toggleEnabled(id) {
        setEnabled(prev => {
            return {
                start: id === 'start' ? !prev.start : false,
                aboutMe: id === 'aboutMe' ? !prev.aboutMe : false,
                cv: id === 'cv' ? !prev.cv : false,
                skills: id === 'skills' ? !prev.skills : false
            }
        })
    }
    console.log(enabled)

    return (
        <div>
            <Header />
            <Main />
            <div className="lower-part">
                <Contact />
                <Navigation id={enabled} toggleEnabled={toggleEnabled}/>
            </div>
        </div>
    );
}

export default App;
